    console.log(`Gross Monthly Income: $${monthlyIncome}`);
    console.log(`Monthly Income Tax: $${monthlyIncomeTax}`);
    console.log(`Net Monthly Income: $${monthlyIncomeNet}`);
    console.log(`=========================================`);
  }
}

